import React from "react";

const Card = ({ onClick, cardValue }) => {
  // console.log(cardValue._id)
  const handleCardClick = (e) => {
    e.stopPropagation(); // Prevent event propagation
    onClick(); // Call the provided onClick handler
  };
  return (
    <div className="card">
      <div className="card-body">
        <h5 className="card-title">{cardValue.title}</h5>
        <p className="card-text">(0 of 3) SubTasks</p>
      </div>
    </div>
  );
};

export default Card;
